import React from "react";
import meRing from "../..//Assets/meRing.png";
import BGanim from "../BGanim";
import "./Hero.css";
const Hero = () => {
  return (
    <section className="hero">
      <img src={meRing} alt="myProfile-img" draggable="false" />
    </section>
  );
};
export default Hero;
